// Generated by Mochi transpiler
String _substr(String s, num start, num end) {
  var n = s.length;
  int s0 = start.toInt();
  int e0 = end.toInt();
  if (s0 < 0) s0 += n;
  if (e0 < 0) e0 += n;
  if (s0 < 0) s0 = 0;
  if (s0 > n) s0 = n;
  if (e0 < 0) e0 = 0;
  if (e0 > n) e0 = n;
  if (s0 > e0) s0 = e0;
  return s.substring(s0, e0);
}

List<int> odd_sieve(int _num) {
  if (_num <= 2) {
    return ([] as List).map((e) => (e is BigInt ? e.toInt() : (e as int))).toList();
  }
  if (_num == 3) {
    return [2];
  }
  int size = _num ~/ 2 - 1;
  List<bool> sieve = <bool>[];
  int idx = 0;
  while (idx < size) {
    sieve = [...sieve, true];
    idx = idx + 1;
  }
  int i = 3;
  while (i * i <= _num) {
    int s_idx = i ~/ 2 - 1;
    if (sieve[s_idx]) {
    int j = i * i;
    while (j < _num) {
    int j_idx = j ~/ 2 - 1;
    while (sieve.length <= j_idx) { sieve.add(false); } sieve[j_idx] = false;
    j = j + 2 * i;
  };
  }
    i = i + 2;
  }
  List<int> primes = [2];
  int n = 3;
  int k = 0;
  while (n < _num) {
    if (sieve[k]) {
    primes = [...primes, n];
  }
    n = n + 2;
    k = k + 1;
  }
  return primes;
}

void main() {
  print("[" + odd_sieve(2).join(', ') + "]");
  print("[" + odd_sieve(3).join(', ') + "]");
  print("[" + odd_sieve(10).join(', ') + "]");
  print("[" + odd_sieve(20).join(', ') + "]");
}
